/*
 * Advanced lens. - default implementation
 *
 * f - refers to kibi helper with following functions available
 *   defaultExpansion(graphid, idList, relations)
 *   executeGremlinQuery(graphId, queryTemplate, idList)
 *   addResultsToGraph(graphId, queriedIds, results)
 *   executeEsSearch(index, type, body, size)
 *   getKibiRelations()
 *   openModal(graphId, title, innerHtml)
 *   handleModalResult(graphId, result)
 *   buildSelectEntityMenu(graphModel, precomputed, excludeTypes)
 *   isNodeCombo(graphId, itemId)
 *   getNodeCombo(graphId, itemId)
 *   fetchDatasourceSample(datasourceId, query, rowLimit = 2000, maxTextSize = 10000)
 *   guessIndexDatasources(selectedIndices, neo4jDatasources)
 *   fetchSavedDatasources()
 *   executeEsMget(payload)
 *   createNotifier(options)
 *
 * Globals:
 *
 * - kibiTimezone: a string containing the value of the dateFormat:tz setting.
 * - moment: an instance of moment-timezone with the default timezone set to the value of the dateFormat:tz setting.
 * - jexl: instance of an Javascript Expression Language.
 * - mappedColors: an instance of a color mapping helper.
 * - fieldHelper: getFields - method to grab a list of fields for given indexPattern
 *                getFilterByEsType - method create an angular filter to filter out fields by esType
 *                flattenObj - method to flatten object properties usefull to flaten keys of nested es objects
 *
 * For detailed documentation of the above please contact support team
 *
 * NOTE:
 *   Use ECMAScript 5
 *   The name of the main function must be "onGraphUpdate"
 *   The function should always return a promise which resolves
 *   with a modified graph model
 *   The lens definition must be in a "getLensDefinition" function.
 *   The lens should always contain a "setParams" function, used during the lenses execution.
 */

var _parameters = {
  entityId: '__$$ALL$__',
  entityIdSet: new Set(),
  condition: '',
  expression: '',
  imageMode: 'url',
  modelProperty: '',
  when: 'always',
  selection: [],
  methods: {}
};

function getLensDefinition(graphId, graphModel, selection, precomputed) {
  var html = '<label>Entity Type</label>';
  let entities = [];
  html += f.buildSelectEntityMenu(graphModel, precomputed, entities);

  html    += '<label>If ...</label>';

  html    += '<br><label><input type="radio" value="always" ng-model="params.when">always</label>';

  html    += '<br><input type="radio" value="selection" ng-model="params.when">';
  html    += '<label>only for the {{ params.selection.length }} selected elements.</label>';
  html    += '<button ng-hide="params.when !== \'selection\'" ng-click="params.methods.updateSelection()">';
  html    += ' <i class="fa fa-sync"></i>';
  html    += '</button><span> </span>';
  html    += '<button ng-hide="params.when !== \'selection\'" ng-click="params.methods.showSelection()"><i class="fa fa-eye"></i></button>';

  html    += '<br><input type="radio" value="conditional" ng-model="params.when">';
  html    += '<label>only if the condition is true</label>';
  html    += '<expression-editor entity-id-set="data.entityIdSet" required-field="params.when === \'conditional\'"';
  html    += ' ng-hide="params.when !== \'conditional\'" ';
  html    += ' type="params.entityId" expression="params.condition" error-message="data.errorMessages.condition">';
  html    += '</expression-editor>';

  html    += '<br><label>Set this property</label>';
  html    += '<model-property-selector property="params.modelProperty"';
  html    += ' required-field="true" changed="params.methods.propertyChanged(prop)">';
  html    += '</model-property-selector>';
  html    += '<label>To</label>';
  html    += '<br><label ng-if="params.methods.isPathIcon()">';
  html    += '<input type="radio" value="url" ng-model="params.imageMode"';
  html    += ' ng-change="params.methods.imageModeChanged()">Url</label>';
  html    += '<br><label ng-if="params.methods.isPathIcon()">';
  html    += '<input type="radio" value="localImage" ng-model="params.imageMode"';
  html    += ' ng-change="params.methods.imageModeChanged()">Local image</label>';
  html    += '<expression-editor entity-id-set="data.entityIdSet" disabled="!params.modelProperty"';
  html    += ' required-field="true" error-message="data.errorMessages.expression"';
  html    += ' type="params.entityId" expression="params.expression">';
  html    += '</expression-editor>';

  _parameters.selection = selection;
  _parameters.methods = {
    imageModeChanged: function () {
      if (this.params.imageMode === 'url') {
        this.params.expression = '\'https://cdn4.iconfinder.com/data/icons/fugue/icon_shadowless/dummy.png\'';
      } else {
        this.params.expression = '\'set1/bank.png\'';
      }
    },
    propertyChanged: function (prop) {
      if (prop.name === 'pathIcon') {
        this.params.imageMode = 'url';
      }
      this.params.expression = prop.default;
    },
    showSelection: function () {
      this.loadItems({ selection: this.params.selection });
    },
    isPathIcon: function() {
      var prop = this.params.modelProperty;
      return prop.name === 'pathIcon';
    },
    updateSelection: function () {
      this.params.selection = _.filter(this.getSelection(), function (id) {
        // check if the id has the syntax of a node
        return id.split('/').length === 3;
      });
    }
  };

  return Promise.resolve({
    displayName: 'Advanced lens 2',
    type: 'Advanced',
    template: html,
    params: _parameters,
    data: {
      entityIdSet: precomputed.entityIdSet,
      currentSelection: selection,
      entities: entities
    }
  });
}

function setParams(params) {
  _parameters = params;
}

function checkParams(params, graphModel) {
  var entityId = params.entityId;
  var expression = params.expression.replace(/\n\r?/g, ' ');
  var proms = [];
  if (!_.isEmpty(expression)) {
    // force jexl to generate a string response
    expression = '\'\'+' + expression;
    const node = graphModel.nodes[0];
    if ( node && (entityId === '__$$ALL$__' || node.entityId === entityId)) {
      proms.push(jexl.eval(expression, node).then(function (res) {
      }).catch(function (reason) {
        graphModel.errorMessages[lens.id] = {
          model: 'expression',
          reason: reason
        };
        return Promise.resolve();
      }));
    }
  }
  return Promise.all(proms)
  .then(function () {
    return graphModel;
  });
}

function onGraphUpdate(graphId, graphModel) {
  var entityId = _parameters.entityId;
  var condition = _parameters.condition.replace(/\n\r?/g, ' ');
  var expression = _parameters.expression.replace(/\n\r?/g, ' ');
  var prop = _parameters.modelProperty;
  var proms = [];
  var selection = _parameters.selection;
  var when = _parameters.when;
  var imageMode = _parameters.imageMode;
  var lensDisplayName = lens && lens.state && lens.state.displayName ? lens.state.displayName : 'Advanced lens';

  function parseDate(date, timezone) {
    return moment.tz(date, 'YYYY-MM-DD HH:mm:SS', timezone);
  }

  var referencePrefix;

  if (when === 'always') {
    condition = 'true';
    referencePrefix = when;
  } else if (when === 'selection') {
    condition = 'false';
    referencePrefix = 'for ' + when;
  } else {
    referencePrefix = 'when ' + condition;
  }

  if (!_.isEmpty(expression) && !_.isEmpty(condition) && prop && !_.isEmpty(prop.name)) {
    if (prop.type === 'string') {
      // force jexl to generate a string response
      expression = '\'\'+' + expression;
    }
    _.each(graphModel.nodes, function (node) {
      if (!f.isNodeCombo(graphId, node.id)
          && ((entityId === '__$$ALL$__')
          || (node.entityId === entityId))) {
        if (when === 'selection') {
          var filtered = selection.filter(function (item) {
            if (item === node.id) {
              return true;
            }
            return false;
          });
          condition = filtered.length ? 'true' : 'false';
        }
        proms.push(jexl.eval(condition, node).then(function (condResult) {
          if (condResult && _.isBoolean(condResult)) {
            return jexl.eval(expression, node).then(function (res) {
              if (prop.type === 'boolean' && _.isBoolean(res)) {
                node[prop.name] = res;
              } else if (prop.type === 'number' && _.isFinite(res)) {
                node[prop.name] = res;
              } else if (prop.type === 'array' && _.isString(res)) {
                var arrRes = JSON.parse(res);
                if (_.isArray(arrRes)) {
                  if (prop.name === 'glyphs') {
                    const property = node[prop.name] ? node[prop.name] : [];
                    node[prop.name] = property.concat(arrRes);
                  } else {
                    node[prop.name] = arrRes;
                  }
                }
              } else if (prop.type === 'object' && _.isPlainObject(res)) {
                node[prop.name] = res;
              } else if (prop.type === 'location' && _.isString(res)) {
                var latLong = res.split(',');
                node[prop.name] = {
                  lat: +latLong[0],
                  lng: +latLong[1]
                };
              } else if (prop.type === 'time' && _.isString(res)) {
                var momentTime = parseDate(res, 'UTC');
                if (momentTime) {
                  node[prop.name] = momentTime.valueOf()
                    - moment.tz.zone(kibiTimezone).utcOffset(momentTime.valueOf()) * 60000;
                }
              } else if (prop.type === 'string' && _.isString(res)) {
                console.log("res: " + res);
                const propValue = res.replace(/\\n/, '\n');
                console.log("propValue: " + propValue);
                if (prop.name === 'pathIcon') {
                  console.log("prop.name: " + prop.name);
                  if (imageMode === 'localImage') {
                    console.log("imageMode: " + imageMode);
                    node[prop.name] = '/plugins/graph_browser_vis/icons/' + propValue;
                  } else if (imageMode === 'url') {
                    node[prop.name] = 'image_proxy?url=' + propValue;
                    console.log("node[prop.name]: " + node[prop.name]);
                  }
                }
                else {
                  node[prop.name] = propValue;
                }
              }
            }).catch(function (reason) {
              graphModel.errorMessages[lens.id] = {
                model: 'expression',
                reason: reason
              };
              return Promise.resolve();
            });
          }
          return Promise.resolve();
        }).catch(function (reason) {
          graphModel.errorMessages[lens.id] = {
            model: 'condition',
            reason: reason
          };
          return Promise.resolve();
        }));
      }
    });
  }

  return Promise.all(proms)
  .then(function () {
    return graphModel;
  });
}

/*
 * Show record content on tooltips lens. - default implementation
 *
 * f - refers to kibi helper with following functions available
 *   defaultExpansion(graphid, idList, relations)
 *   executeGremlinQuery(graphId, queryTemplate, idList)
 *   addResultsToGraph(graphId, queriedIds, results)
 *   executeEsSearch(index, type, body, size)
 *   getKibiRelations()
 *   openModal(graphId, title, innerHtml)
 *   handleModalResult(graphId, result)
 *   buildSelectEntityMenu(graphModel, precomputed, excludeTypes)
 *   isNodeCombo(graphId, itemId)
 *   getNodeCombo(graphId, itemId)
 *   fetchDatasourceSample(datasourceId, query, rowLimit = 2000, maxTextSize = 10000)
 *
 * Globals:
 *
 * - kibiTimezone: a string containing the value of the dateFormat:tz setting.
 * - moment: an instance of moment-timezone with the default timezone set to the value of the dateFormat:tz setting.
 * - jexl: instance of an Javascript Expression Language.
 *
 * For detailed documentation of the above please contact support team
 *
 * NOTE:
 *   Use ECMAScript 5
 *   The name of the main function must be "onGraphUpdate"
 *   The function should always return a promise which resolves
 *   with a modified graph model
 *   The lens definition must be in a "getLensDefinition" function.
 */

var _parameters = {
  entityId: '__$$ALL$__',
  fieldName: 'id',
  selection: [],
  methods: {}
};

function getLensDefinition(graphId, graphModel, selection, precomputed) {
  var html = '<label>Entity Type</label>';
  let entities = [];
  html += f.buildSelectEntityMenu(graphModel, precomputed, entities);

  _parameters.methods = {
    filterType: function (value) {
      return this.params && this.params.entityId &&
        (this.params.entityId === value.entityId || this.params.entityId === '__$$ALL$__');
    }
  };

  return Promise.resolve({
    displayName: 'Show record content on tooltips',
    type: 'Tooltip',
    template: html,
    params: _parameters,
    data: {
      entities: entities
    }
  });
}

function setParams(params) {
  _parameters = params;
}

function onGraphUpdate(graphId, graphModel) {
  var entityId = _parameters.entityId;
  var lensDisplayName = lens && lens.state && lens.state.displayName ? lens.state.displayName : 'Show record content on tooltips';

  function buildFieldValue(fieldKey, fieldValue, rowIndex) {
    var rowClass = (rowIndex % 2 === 0) ? 'property-odd' : 'property-even';
    var fieldTooltip = '<div class="property-tooltips ' + rowClass + '">';

    if (!_.isObject(fieldValue)) {
      fieldTooltip += '<div class="property-reference">' + fieldKey + '</div>';
      fieldTooltip += '<div class="property-value">' + fieldValue + '</div>';
    } else {
      // special handling for fields that are missing due to an index pattern not refreshed
      if (!fieldValue || _.size(fieldValue) === 0) {
        fieldTooltip += '<div class="property-reference">' + fieldKey + '</div>';
        fieldTooltip += '<div class="property-value"></div>';
      } else {
        _.each(fieldValue, function (fieldSubvalue, fieldSubkey) {
          fieldTooltip += '<div class="property-reference">' + fieldKey + '.' + fieldSubkey + '</div>';
          fieldTooltip += '<div class="property-value">' + fieldSubvalue + '</div>';
        });
      }
    }

    fieldTooltip += '</div>';
    return fieldTooltip;
  }

  _.each(graphModel.nodes, function (node) {
    if (!f.isNodeCombo(graphId, node.id) && (entityId === '__$$ALL$__' || node.entityId === entityId)) {
      if (!node.tooltip) {
        node.tooltip = '';
      }
      node.tooltip += '<div class="lens-title">' + lensDisplayName + '</div>';
      var sortedPayload = {};
      Object.keys(node.payload).sort().forEach(function (key) {
        sortedPayload[key] = node.payload[key];
      });
      var rowIndex = 0;
      _.each(sortedPayload, function (value, key) {
        node.tooltip += buildFieldValue(key, value, rowIndex);
        rowIndex++;
      });
    }
  });

  return Promise.resolve(graphModel);
}

var allEntities = null;
var allRelations = [];
var fieldsByEntity = null;

var _parameters = {
  middleEntity: '',
  sourceField: '',
  destField: '',
  autoExpand: false,
  selection: [],
  methods: {
    fieldsByEntity: function (middleEntity, entitiesMap) {
	    if (!fieldsByEntity) {
  	    fieldsByEntity = [];
        localFieldNames = []
        _.each(allRelations, function (relation) {
          if (relation.domain.id === middleEntity) {
            if (!localFieldNames.includes(relation.domainField)) {
              fieldInfo = {'name': relation.domainField};
              fieldsByEntity.push(fieldInfo);
              localFieldNames.push(relation.domainField);
            }
          }
        })
        fieldsByEntity.sort(function (a, b) {
         return a['name'].toLowerCase().localeCompare(b['name'].toLowerCase());
        })
	    }
      return fieldsByEntity;
	  },
    allEntities: function (entitiesMap) {
      if (!allEntities) {
        allEntities = []
        _.forOwn(entitiesMap, function (entVal, entKey) {
          allEntities.push({'id': entVal.id, 'label': entVal.label})
        })
      }
      return allEntities;
    },
    middleEntityChange: function (params) {
      params.sourceField = undefined;
      params.destField = undefined;
      fieldsByEntity = null;
    },
    sourceFieldChange: function (params) {
      if (params.sourceField === params.destField) {
        params.destField = undefined;
      }
    },
    destFieldChange: function (params) {
      if (params.sourceField === params.destField) {
        params.sourceField = undefined;
      }
    },

  }
};

function getLensDefinition(graphId, graphModel, selection, precomputed) {
  return f.getKibiRelations()
    .then(function (relations) {
      // Build the global list of relations
      allRelations = [];
      _.each(relations, function (relation) {
        allRelations.push(relation);
      })
      // Build the entity options once
      let entities = [];
      _.forOwn(precomputed.entityMap, function(entVal, entKey) {
        entities.push(entVal)
      })
      entities.sort(function (a, b) {
        return a['label'].toLowerCase().localeCompare(b['label'].toLowerCase());
      });
      var entitiesMap = _.keyBy(entities, 'id');

      var html = '';
      html += '  <label for="firstSelect"> Middle Entity: </label><br>'
      html += '  <select'
      html += '    id="firstSelect"'
      html += '    ng-model="params.middleEntity" '
      html += '    ng-change="params.methods.middleEntityChange(params)"'
      html += '    ng-options="entity.id as entity.label for entity in params.methods.allEntities(data.entitiesMap)"'
      html += '    class="form-control"'
      html += '  >';
      html += '    <option value="" disabled ng-selected=true hidden>Select a field</option>';
      html += '  </select>';

      html += '<div ng-if="params.middleEntity">';
      html += '  <label for="firstSelect"> Source field: </label><br>'
      html += '  <select'
      html += '    id="firstSelect"'
      html += '    ng-model="params.sourceField" '
      html += '    ng-change="params.methods.sourceFieldChange(params)"'
      html += '    ng-options="fieldInfo.name as fieldInfo.name for fieldInfo in params.methods.fieldsByEntity(params.middleEntity, data.entitiesMap)"'
      html += '    class="form-control"'
      html += '  >';
      html += '    <option value="" disabled ng-selected=true hidden>Select a field</option>';
      html += '  </select>';
      html += '  <label for="firstSelect">Destination field: </label><br>'
      html += '  <select'
      html += '    id="firstSelect"'
      html += '    ng-model="params.destField" '
      html += '    ng-change="params.methods.destFieldChange(params)"'
      html += '    ng-options="fieldInfo.name as fieldInfo.name for fieldInfo in params.methods.fieldsByEntity(params.middleEntity, data.entitiesMap)"'
      html += '    class="form-control"'
      html += '  >';
      html += '    <option value="" disabled ng-selected=true hidden>Select a field</option>';
      html += '  </select><br>';
      html += '</div>';

      return {
        displayName: 'Node to edge by fields',
        type: 'Transform',
        template: html,
        params: _parameters,
        data: {
          currentSelection: selection,
          entities,
          entitiesMap,
          relations
        }
      };
    });
}

function setParams(params) {
  _parameters = params;
}

function onGraphUpdate(graphId, graphModel, oldModel, precomputed) {
  if (graphModel.nodes.length === 0) {
    return Promise.resolve(graphModel);
  }

  var middleEntity = _parameters.middleEntity;
  var sourceField = _parameters.sourceField;
  var destField = _parameters.destField;

  return f.getKibiRelations()
    .then(function (relations) {
      var middleNodeIds = [];
      var middleNodesMap = {};
      var sourceRelIds = [];
      var destRelIds = [];
      _.each(relations, function(relation) {
        if (relation.domain.id === middleEntity && relation.domainField === sourceField) {
          sourceRelIds.push(relation.id);
        }
        if (relation.range.id === middleEntity && relation.rangeField === sourceField) {
          sourceRelIds.push(relation.id);
        }
        if (relation.domain.id === middleEntity && relation.domainField === destField) {
          destRelIds.push(relation.id);
        }
        if (relation.range.id === middleEntity && relation.rangeField === destField) {
          destRelIds.push(relation.id);
        }
      })
      _.each(graphModel.nodes, function (node) {
        var nodeId = node.id;
        if (node.entityId === middleEntity) {
          middleNodesMap[nodeId] = node;
          middleNodeIds.push(nodeId);
        }
      });

      var expandPromise = Promise.resolve([]);

      return expandPromise
        .then(function (expansionResults) {
          var middleNodeRelationsMap = {};

          _.each(graphModel.relations, function (link) {
            processLink(link, middleNodesMap, middleNodeRelationsMap, sourceRelIds, destRelIds);
          });

          // Now build the links
          _.forOwn(middleNodeRelationsMap, function (linksObj, middleNodeId) {
            if (linksObj.fir.length > 0 && linksObj.sec.length > 0) {
              var middleNode = middleNodesMap[middleNodeId];
              middleNode.hidden = true;
              var nodeState = {
                label: middleNode.label,
                size: middleNode.size * 3,
                color: middleNode.color,
                hidden: f.isHiddenNode(graphId, middleNodeId),
                time: middleNode.time,
                entityId: middleNode.entityId,
                nodeId: middleNode.id,
                tooltip: middleNode.tooltip,
                legendTooltip: middleNode.legendTooltip
              };
              _.each(linksObj.fir, function (first) {
                var nodeOut = first.out !== middleNodeId ? first.out : first.in;
                _.each(linksObj.sec, function (second) {
                  var nodeIn = second.out !== middleNodeId ? second.out : second.in;
                  graphModel.relations.push(createScriptedLink(nodeIn, nodeOut, nodeState, middleNodeId));
                });
              });
            }
          });

          return graphModel;
        });
    });
}

function processLink(link, middleNodesMap, middleNodeRelationsMap, sourceRelIds, destRelIds) {
  var middleNode = middleNodesMap[link.in] || middleNodesMap[link.out] || null;
  if (!!middleNode) {
    var nodeProps = middleNodeRelationsMap[middleNode.id] || { fir: [], sec: [] };
    if(sourceRelIds.includes(link.relId)) {
      nodeProps.fir.push(link);
    } else if (destRelIds.includes(link.relId)) {
      nodeProps.sec.push(link);
    }
    middleNodeRelationsMap[middleNode.id] = nodeProps;
  }
}

function createScriptedLink(nodeIn, nodeOut, nodeState, nodeId) {
  return {
    ...nodeState,
    id: hashCode(nodeIn + nodeOut + nodeId),
    direction: 'in',
    in: nodeIn,
    out: nodeOut,
    volatile: true
  };
}

function hashCode(s){
  return 'ASSOCIATED_EDGE-'+ s.split('').reduce(function(a,b){a=((a<<5)-a)+b.charCodeAt(0);return a&a},0);
}

/*
 * Associate records based on ontology lens - default implementation
 *
 * f - refers to kibi helper with following functions available
 *   getExpansionOptions(graphid)
 *   defaultExpansion(graphid, idList, relations)
 *   addResultsToGraph(graphId, queriedIds, results)
 *   executeEsSearch(index, type, body, size)
 *   getKibiRelations()
 *   openModal(graphId, title, innerHtml)
 *   handleModalResult(graphId, result)
 *   buildSelectEntityMenu(graphModel, precomputed, excludeTypes)
 *   isNodeCombo(graphId, itemId)
 *   getNodeCombo(graphId, itemId)
 *   fetchDatasourceSample(datasourceId, query, rowLimit = 2000, maxTextSize = 10000)
 *   guessIndexDatasources(selectedIndices, neo4jDatasources)
 *   fetchSavedDatasources()
 *   executeEsMget(payload)
 *   createNotifier(options)
 *   shortestPathsWithFederateJoins(
 *     graphId, graphSelection, { maxPathLength = 10, maxJoinRecordsCount = 500 })
 *   resolveIdFromCurrentDataspace(savedObjectId)
 *
 * Globals:
 *
 * - kibiTimezone: a string containing the value of the dateFormat:tz setting.
 * - moment: an instance of moment-timezone with the default timezone set to the value of the dateFormat:tz setting.
 * - jexl: instance of an Javascript Expression Language.
 * - mappedColors: an instance of a color mapping helper.
 * - fieldHelper: getFields - method to grab a list of fields for given indexPattern
 *                getFilterByEsType - method create an angular filter to filter out fields by esType
 *                flattenObj - method to flatten object properties usefull to flaten keys of nested es objects
 *
 * For detailed documentation of the above please contact support team
 *
 * NOTE:
 *   Use ECMAScript 5
 *   The name of the main function must be "onGraphUpdate"
 *   The function should always return a promise which resolves
 *   with a modified graph model
 *   The lens definition must be in a "getLensDefinition" function.
 *   The lens should always contain a "setParams" function, used during the lenses execution.
 */

var _parameters = {
  leftEntity: '',
  middleEntity: '',
  rightEntity: '',
  selection: [],
  methods: {}
};

function getLensDefinition(graphId, graphModel, selection, precomputed) {
  // Build the entity options once
  let entities = [];

  // Middle entity select
  var html = '<label>Entity Type</label>';
  html += f.buildSelectEntityMenu(graphModel, precomputed, entities, [], { entityId: 'params.middleEntity', entities: 'data.entities' });

  // Left entity select
  html += '<label>Left Entity Type</label>';
  html += f.buildSelectEntityMenu(graphModel, precomputed, entities, [], { entityId: 'params.leftEntity', entities: 'data.entities' });

  // Right entity select
  html += '<label>Right Entity Type</label>';
  html += f.buildSelectEntityMenu(graphModel, precomputed, entities, [], { entityId: 'params.rightEntity', entities: 'data.entities' });

  return Promise.resolve({
    displayName: 'Associate records based on ontology',
    type: 'Process',
    template: html,
    params: _parameters,
    data: {
      currentSelection: selection,
      entities: entities
    }
  });
}

function setParams(params) {
  _parameters = params;
}

function onGraphUpdate(graphId, graphModel, oldModel, precomputed) {
  var middleEntity = _parameters.middleEntity;
  var leftEntity = _parameters.leftEntity;
  var rightEntity = _parameters.rightEntity;

  var newExpandedNodes = [];

  var nodesMap = _.reduce(graphModel.nodes, function (map, node) {
    map[node.id] = node;
    return map;
  }, {});

  return f.getKibiRelations()
  .then(function (relations) {
    var filteredRelationIds = [];
    if (relations && relations.length > 0) {
      for (var i = 0; i < relations.length; i++) {
        filteredRelationIds.push(relations[i].id);
      }
    }

    function composeLinks (leftNode, rightNode, nodeState, middleNode) {
      var linkPair = {
        in: leftNode.id,
        out: rightNode.id
      };

      var newRelation = createScriptedLink(linkPair, nodeState, middleNode.id, 'in');

      var graphModelRightNode = nodesMap[rightNode.id];
      if (graphModelRightNode) {
        copyProperties(graphModelRightNode, rightNode);
      }
      var graphModelLeftNode = nodesMap[leftNode.id];
      if (graphModelLeftNode) {
        copyProperties(graphModelLeftNode, leftNode);
      }

      rightNode.volatile = true;
      leftNode.volatile = true;

      if (rightNode.x === undefined || rightNode.y === undefined) {
        rightNode.x = middleNode.x;
        rightNode.y = middleNode.y;
      }
      if (leftNode.x === undefined || leftNode.y === undefined) {
        leftNode.x = middleNode.x;
        leftNode.y = middleNode.y;
      }
      newExpandedNodes.push(rightNode);
      newExpandedNodes.push(leftNode);
      graphModel.relations.push(newRelation);

      // manage nodes in combos
      var leftNodeComboId = f.getNodeCombo(graphId, leftNode.id);
      var rightNodeComboId = f.getNodeCombo(graphId, rightNode.id);

      if (leftNodeComboId !== null || rightNodeComboId !== null) {
        //If both left and right nodes are in the same combo new link must be in that combo
        if (leftNodeComboId === rightNodeComboId) {
          var nodeCombo = _.find(graphModel.nodes, function (node) {
            return middleNode.id === leftNodeComboId;
          });
          nodeCombo.combo.linkIds.push(newRelation.id);
        } else { //If left or right nodes are in differents combos must create a new combo link
          var newComboRelation =  _.cloneDeep(newRelation);
          newComboRelation.id = "_combolink_" + newRelation.id;
          if (leftNodeComboId !== null) {
            newComboRelation.in = leftNodeComboId;
          }
          if (rightNodeComboId !== null) {
            newComboRelation.out = rightNodeComboId;
          }
          newComboRelation.combo = {
            linkIds: [newRelation.id]
          };
          graphModel.relations.push(newComboRelation);
        }
      }
    }

    function processNode (node) {
      if (!f.isNodeCombo(graphId, node.id) && node.entityId && node.entityId === middleEntity) {
        var nodeState = {
          label: node.label,
          size: node.size * 3,
          color: node.color,
          hidden: f.isHiddenNode(graphId, node.id),
          time: node.time,
          entityId: node.entityId,
          nodeId: node.id,
          tooltip: node.tooltip,
          legendTooltip: node.legendTooltip
        };
        node.hidden = true;

        return f.defaultExpansionAndParse(graphId, [node.id], filteredRelationIds)
          .then(function (results) {
            var leftNodes = results.filter(function (res) { return res.entityId === leftEntity ;});
            if (leftNodes.length === 0) {
              // not hide the middle entity if nothing is aggregatable
              node.hidden = false;
              return;
            }
            var rightNodes = _.filter(results, function (result) {
              return result.entityId === rightEntity &&
                !(leftNodes.length === 1 && result.id === leftNodes[0].id);
            });
            if (rightNodes.length === 0) {
              // not hide the middle entity if nothing is aggregatable
              node.hidden = false;
              return;
            }

            // If both sides have multiple nodes return, we don't handle this use case yet
            if (leftNodes.length > 1 && rightNodes.length > 1) {
              return;
            }

            if (leftNodes.length > 1) {
              _.each(leftNodes, function (leftNode) {
                composeLinks(leftNode, rightNodes[0], nodeState, node);
              });
            } else {
              _.each(rightNodes, function (rightNode) {
                composeLinks(leftNodes[0], rightNode, nodeState, node);
              });
            }
        });
      } else {
        return Promise.resolve();
      }
    }

    // process 3 requests a time
    return Promise.map(graphModel.nodes, processNode, { concurrency: 3 })
    .then(function () {
      graphModel.nodes = graphModel.nodes.concat(newExpandedNodes);
      return graphModel;
    });
  });
}

function createScriptedLink(linkPair, nodeState, nodeId, direction) {
  var newLink = {
    id: hashCode(linkPair.in + linkPair.out + nodeId),
    direction: direction,
    in: linkPair.in,
    out: linkPair.out,
    volatile: true
  };
  _.each(nodeState, function (value, key) {
    newLink[key] = value;
  });
  return newLink;
}

function copyProperties(srcNode, targetNode) {
  _.each(srcNode, function (value, key) {
    targetNode[key] = value;
  });
}

function hashCode(s){
  return 'ASSOCIATED_EDGE-'+ s.split('').reduce(function(a,b){a=((a<<5)-a)+b.charCodeAt(0);return a&a},0);
}
